import React from "react";

function AboutSection() {
  return (
    <section className="max-w-2xl mx-auto mt-12 text-center">
      <h2 className="text-2xl font-bold text-gray-800 mb-4">About Me</h2>
      <p className="text-gray-600 leading-relaxed">
        Saya adalah seorang Frontend Developer yang berfokus pada pembuatan
        antarmuka web modern dan responsif. Saya suka mengubah desain Figma
        menjadi aplikasi web interaktif menggunakan React dan Tailwind CSS.
      </p>
    </section>
  );
}

export default AboutSection;
